//======================================================================================================================
// Helpers
//----------------------------------------------------------------------------------------------------------------------
void put_start_frame(PIO pio, uint sm)
{
	pio_sm_put_blocking(pio, sm, 0u);
}


//----------------------------------------------------------------------------------------------------------------------
void put_end_frame(PIO pio, uint sm)
{
	pio_sm_put_blocking(pio, sm, ~0u);
}


//----------------------------------------------------------------------------------------------------------------------
void put_rgb888(PIO pio, uint sm, uint8_t r, uint8_t g, uint8_t b)
{
    pio_sm_put_blocking(pio, sm,
                        0x7 << 29 |                   // magic
                        (BRIGHTNESS & 0x1f) << 24 |   // global brightness parameter
                        (uint32_t) b << 16 |
                        (uint32_t) g << 8 |
                        (uint32_t) r << 0
    );
}






//======================================================================================================================
// Setup Function
//----------------------------------------------------------------------------------------------------------------------
void setup(void)
{
	Serial.begin(115200);

	uint8_t offset = pio_add_program(LED_PIO, &apa102_mini_program);
	apa102_mini_program_init(LED_PIO, LED_SM_A, offset, SERIAL_FREQ, PIN_CLK_A, PIN_DATA_A);
	apa102_mini_program_init(LED_PIO, LED_SM_B, offset, SERIAL_FREQ, PIN_CLK_B, PIN_DATA_B);
}

void setup1(void)
{
	rtt_setup();
}




//======================================================================================================================
// Loop Function
//----------------------------------------------------------------------------------------------------------------------
void loop(void)
{
	static uint8_t previous_column = 0;
	static uint8_t offset = 60;
	static uint32_t previous_time = 0;

	if (rtt_rotating())
	{
		uint8_t current_column = rtt_column();

		if (current_column != previous_column)
		{
			previous_column = current_column;

			current_column = (current_column + offset) % RES_HORIZ;

			put_start_frame(LED_PIO, LED_SM_A);
			for (int idx = RES_VERT - 1; idx > 0; idx -= 2)
			{
				uint32_t pixel = Image[current_column][idx];
				put_rgb888(LED_PIO, LED_SM_A, (uint8_t)(pixel >> 16), (uint8_t)(pixel >> 8), (uint8_t)pixel);
			}
			put_end_frame(LED_PIO, LED_SM_A);

			put_start_frame(LED_PIO, LED_SM_B);
			for (int idx = RES_VERT - 2; idx >= 0; idx -= 2)
			{
				uint8_t opposite_column = (uint8_t)(((uint16_t)current_column + (RES_HORIZ / 2)) % RES_HORIZ);
				uint32_t pixel = Image[opposite_column][idx];
				put_rgb888(LED_PIO, LED_SM_B, (uint8_t)(pixel >> 16), (uint8_t)(pixel >> 8), (uint8_t)pixel);
			}
			put_end_frame(LED_PIO, LED_SM_B);
		}
	}
	else
	{
		// Go black when not rotating.
		put_start_frame(LED_PIO, LED_SM_A);
		for (int idx = 0; idx < RES_VERT / 2; idx++)
		{
			put_rgb888(LED_PIO, LED_SM_A, 0, 0, 0);
		}
		put_end_frame(LED_PIO, LED_SM_A);

		put_start_frame(LED_PIO, LED_SM_B);
		for (int idx = 0; idx < RES_VERT / 2; idx++)
		{
			put_rgb888(LED_PIO, LED_SM_B, 0, 0, 0);
		}
		put_end_frame(LED_PIO, LED_SM_B);
	}

	uint32_t elapsed = millis() - previous_time;
	if (elapsed > 250)
	{
		previous_time += 250;
		offset = (offset + 1) % RES_HORIZ;
	}
}




